import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';
import iconoNofovotiro from '../like.png';


function ListadoFotos(){

    return(
   
        <div>
         <Row className="rowListado">

         <Col md={4} lg={3} xs={12} xl={3} className=" mb-3 d-flex align-items-stretch justif-content-center">
                 
                 <Card className="cardImg"> 
                     <Card.Body className="cardBodyImg">
    
                        <a className="nav-link p-0" href="#">
                            <img src="https://cdn.pixabay.com/photo/2020/04/22/09/59/tree-5077020__340.jpg" className="card-img-top"></img>
                        </a>
                    </Card.Body>
                    
                    <Card.Footer className="my-0">
                            <a className="nav-link text-right p-0"  href="#">
                                <img src={iconoNofovotiro}></img>
                            </a>
                            <small className="text-muted">Titulo: Lores</small>
                            <small className="text-muted"> <a className="nav-link p-0"  href="#">Autor: pixabay</a></small>
                    </Card.Footer>
                         
                 </Card>
                 </Col>


         </Row>
         </div>
    );
}

export default ListadoFotos;
